    $container = $(".b-practic-results__list");
    $container.addClass("swiper-container");

    $wrapper = $container.wrapInner("<div class=\"swiper-wrapper\"/>");

    $container.append("<div class=\"b-practic-results__pagination swiper-pagination\"></div>");
    $container.append("<div class=\"b-practic-results__hand b-practic-results__hand_backward swiper-button-prev\"></div>");
    $container.append("<div class=\"b-practic-results__hand b-practic-results__hand_forward swiper-button-next\"></div>");

